pragma solidity >=0.5.0 <0.9.0;

contract User
{
    struct Transaction
    {
        uint quantity;
        uint price;
    }
    
    struct Stock
    {
        string symbol;
        uint owned;
        Transaction[] buyOrders;
        Transaction[] sellOrders;
    }
    
    address public owner;
    //Stock[] stockList;
    mapping(string => Stock) public stockList;

    function getBuyOrderQuantity(string memory symb) public view returns (uint) {
        return stockList[symb].buyOrders[0].quantity;
    }

    function getBuyOrderPrice(string memory symb) public view returns (uint) {
        return stockList[symb].buyOrders[0].price;
    }

    function getStockValue(string memory symb) public view returns (uint) {
        return stockList[symb].owned;
    }
    
    function compareStrings(string memory a, string memory b) public pure returns (bool) 
    {
        return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))));
    }
    
    modifier canSell(string memory _symbol, uint _quantity)
    {
        if (!compareStrings(stockList[_symbol].symbol,"") && stockList[_symbol].owned >= _quantity) {_;}
        else require(false,"Address does not own enough of the requested stock to sell");
    }
    
    constructor(address _owner) public
    {
        owner = _owner;
    }
    
    function toUpper(string memory str) internal pure returns (string memory) {
        bytes memory bStr = bytes(str);
        bytes memory bUpper = new bytes(bStr.length);
        for (uint i = 0; i < bStr.length; i++) {
            // Uppercase character...
            if ((uint8(bStr[i]) >= 65) && (uint8(bStr[i]) <= 90))
                bUpper[i] = bStr[i];
            // Lowercase - make upper by -32
            else 
                bUpper[i] = bytes1(uint8(bStr[i]) - 32);
        }
        return string(bUpper);
    }
    
    /*
    function canSell(string memory _symbol, uint _quantity) public view returns (bool)
    {
        for (int i = 0; i < stockList.length; i++)
        {
            if (stockList[i].symbol == _symbol && stockList[i].owned >= _quantity)
                return true;
        }
        
        return false;
    }
    */
    
    function getPortfolioInfo(string memory _symbol) public view returns(string memory) 
    {
        string memory sym = toUpper(_symbol);
        if(compareStrings(stockList[sym].symbol,""))
            return "";
        else
            return stockList[sym].symbol;
    }

    function addBuyRequest(string memory _symbol, uint _quantity, uint _priceLimit) public
    {
        string memory sym = toUpper(_symbol);
        
        if(compareStrings(stockList[sym].symbol,""))
        {
			stockList[sym].symbol = sym;
			stockList[sym].owned = 0;
        }
			
		stockList[sym].buyOrders.push(Transaction(_quantity,_priceLimit));
    }
    
    function addSellRequest(string memory _symbol, uint _quantity, uint _priceLimit) public
    {
        string memory sym = toUpper(_symbol);
        
        require(stockList[sym].owned >= _quantity, "Address does not own enough of the requested stock to sell");
        
        stockList[sym].owned -= _quantity;
        stockList[sym].sellOrders.push(Transaction(_quantity,_priceLimit));
    }
    
    function resolveBuyRequest(string memory _symbol, uint _quantity) public returns(uint)
	{
		string memory sym = toUpper(_symbol);
		uint purchased = 0;
		
		for (uint i = 0; i < stockList[sym].buyOrders.length; i++)
		{
			if (stockList[sym].buyOrders[i].quantity > 0)
			{
				if (stockList[sym].buyOrders[i].quantity >= _quantity)
				{
					stockList[sym].buyOrders[i].quantity -= _quantity;
					purchased = _quantity;
					_quantity = 0;
				}
				else
				{
				    purchased += stockList[sym].buyOrders[i].quantity;
					_quantity -= stockList[sym].buyOrders[i].quantity;
					stockList[sym].buyOrders[i].quantity = 0;
				}
			}
			
			if (_quantity <= 0)
				break;
		}
		
		stockList[sym].owned += purchased;
		return purchased;
	}
	
	function resolveSellRequest(string memory _symbol, uint _quantity) public returns(uint)
	{
		string memory sym = toUpper(_symbol);
		uint sold = 0;
		
		for (uint i = 0; i < stockList[sym].sellOrders.length; i++)
		{
			if (stockList[sym].sellOrders[i].quantity > 0)
			{
				if (stockList[sym].sellOrders[i].quantity >= _quantity)
				{
					stockList[sym].sellOrders[i].quantity -= _quantity;
					sold = _quantity;
					_quantity = 0;
				}
				else
				{
				    sold += stockList[sym].sellOrders[i].quantity;
					_quantity -= stockList[sym].sellOrders[i].quantity;
					stockList[sym].sellOrders[i].quantity = 0;
				}
			}
			
			if (_quantity <= 0)
				break;
		}
		
		return sold;
	}
}
